// Auto-generated ambient module declarations to suppress missing-module TypeScript errors
declare module '@/*' {
  const content: any
  export = content
}

declare module '@/components/*' {
  const content: any
  export = content
}

declare module '@/hooks/*' {
  const content: any
  export = content
}

declare module '@/assets/*' {
  const content: any
  export default content
}

declare module '*.png'
declare module '*.jpg'
declare module '*.jpeg'
declare module '*.svg'
